;; @@
(def df (gg4clj/data-frame {:hour (map :hour dat)
                            :group (map :group dat)}))

(gg4clj/view [[:<- :g df]
              (gg4clj/r+
                [:ggplot :g [:aes {:x :hour, :y :group, :group :group}]]
                [:geom_joy2]
                [:scale_y_discrete {:expand (list 0.1 0)}]
                [:scale_x_continuous {:breaks [:seq 0 24 {:by 3}]}]
                [:theme_joy {:font_size 9}])]
             #_{:width 5 :height 3})
